import Link from 'next/link';
import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={'https://img.pokemondb.net/artwork/bulbasaur.jpg'} className="App-logo" alt="logo" />
        <p>
          Welcome to michaeldipaolo.com 
        </p>

        <Link href="/resume" title="Resume">
            <a>Continue to my resume</a>
        </Link>

      </header>
    </div>
  );
}

export default App;
